      <NavLink className="btn-get-started" to="/User" >Start Motor</NavLink>
      <br></br><br></br>
      <NavLink className="btn-get-started" to="/User" >Stop Motor</NavLink>
      <br></br><br></br>
      </div>
    </div>
    </>
      );
};

